import React from "react";
import logo from "../../assets/images/logo.png";
const Navbar = () => {
  return (
    <>
      <nav className="flex items-center justify-between px-4 py-3">
        <div className="w-10 h-10 absolute top-6 left-6">
          <img className="text-white font-bold" src={logo} alt="logo" />
        </div>
        {/* Join Waitlist Button */}
        <button className="absolute top-6 right-6 bg-white text-black font-semibold py-2 px-6 rounded-full shadow-md hover:bg-gray-200 transition">
          Join Waitlist
        </button>
      </nav>
      <div className="bg-white border-b shadow-md sticky top-0 z-50">
        <div className="container mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            {/* Logo */}
            <div className="flex items-center">
              <a href="/" className="text-xl font-bold text-blue-600">
                MyLogo
              </a>
              <button className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700">
                Sign Up
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Navbar;
